import Layout from "../components/layout/layout";

function Dashboard() {
  const position = { container: "w-full h-full" };
  const design = { container: "bg-gray-200" };

  return (
    <Layout>
      <div className={`${position.container} ${design.container}`}>
        <h2>Dashboard</h2>
      </div>
    </Layout>
  );
}

export default Dashboard;
